import React from "react";
import "./ResultCard.css"; // We'll add some styles

function ResultCard({ result }) {
  if (!result) return null;
  const offers = result.loans || [];

  return (
    <div className={`result-card ${result.eligible ? "eligible" : "rejected"}`}>
      <h3>Loan Eligibility Result</h3>
      <p>Status: <strong>{result.eligible ? "✅ Eligible" : "❌ Not Eligible"}</strong></p>
      <p>CIBIL Score: {result.cibil_score}</p>
      <p>Predicted Max Loan: ₹ {result.predicted_amount}</p>

      {result.eligible && offers.length > 0 && (
        <>
          <h4>Available Loan Offers</h4>
          <ul>
            {offers.map((loan, idx) => (
              <li key={idx}>
                <span className="bank">{loan.Bank}</span> ({loan["Loan Type"]}) -
                <span className="rate">{loan["Interest Rate"]}%</span>
                <a href={loan.Link} target="_blank" rel="noreferrer" className="apply-btn">Apply</a>
              </li>
            ))}
          </ul>
        </>
      )}
    </div>
  );
}

export default ResultCard;
